import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav>
      <ul className="nav">
        <li>
          <Link to="/" className="Home">
            BookNotes
          </Link>
        </li>
        <li>
          <Link to="/archives" className="btn btn-light All-Notes">
            All Notes
          </Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
